module.exports = {"title":"Bucket List","date":"2017-06-17T22:12:03.284Z","layout":"post","readNext":"/my-second-post/","path":"/bucket-list/","bodyContent":"My last birthday was one of the bigger ones. 40 years old. While I wasn't particulary sad at turning 40 it did make be think about all the things I'd accomplished so far and about how I thought I may have achieved a few other goals by this age.\n\nWith that in mind I got thinking about the next 10 year block and how I could make that as enjoyable, productive and fulfilling as possible.\n\nI decidied to compose a bucket list, normally a list of things you hope to do in your lifetime, instead this one would be limited to 100 items and a timeframe of 10 years.\n\nI figured that if I knock off all 100 things on this list I'm going to have some good stories to talk about on my 50th birthday.\n\nSuper simple maths - 100 items in ten years is 10 per year so aprox 1 a month with a couple months left out. \n\nSome of the items are much harder/larger than others and will take a whole bunch of effort to achieve. Some can probably be batched up a few at a time etc, some are simple things that maybe easy to achieve but for whatever reason I've no goten around to completing them thus far.\n\nHere is the list:\n\n* Stand under a waterfall\n* Arrive be seaplane\n* Catch a wave surfing\n* Mush a dog sled\n* Travel on a Zip line\n* Do a Backflip\n* Go Fatbiking\n* Paddle board on a warm ocean\n* Go in a submarine\n* Drive a tank\n* Drive a rally car\n* Drive a supercar\n* Fly in a helicopter\n* Learn to scuba dive\n* Walk a rope bridge\n* Zorbing\n* Feed/Wash an elephant\n* Climb a volcano\n* Relax in a natural hot spring\n* Sleep in an igloo\n* Visit the ice hotel\n* Start a fire by rubbing sticks together\n* Swim with sea turtles\n* **Drive a digger - [Done](/drive-a-digger)**\n* See the northern lights\n* Live by the sea\n* Meet someone famous - (define this)\n* Have a book published\n* Create a family tree\n* Learn to carve wood\n* Make pottery on a wheel\n* Be in a TV show audience\n* Be an extra in a film\n* Fly first/business class\n* See a ted talk live\n* Watch the Hakka live\n* See a live Wimbledon match\n* Set a guinness world record\n* Watch a rocket launch\n* Go in a sensory deprivation tank\n* Take a mud bath\n* Catch, cook and eat a fish\n* Create an ice sculpture\n* Create a signature dish\n* Eat a 10 course meal\n* Eat an insect\n* Eat at a michelin 3-star restaurant\n* Eat fondue\n* Learn a song on the piano \n* Make cheese\n* Make my own wine\n* Stomp grapes\n* Have cooking lesson from a famous chef\n* Eat a deep fried mars bar\n* Do random act of kindness\n* Give blood\n* Help someone complete something on their bucket list\n* Learn to speak another language\n* 2 min Handstand\n* One arm hand stand\n* One arm chin up\n* Planche\n* Manna\n* Iron cross\n* Front lever\n* Side lever\n* Go deep sea fishing\n* Shoot a machine gun\n* Ride a snowmobile\n* Drive speed boat\n* Have a go on a Jetski\n* Ride a Segway\n* Drive a dune buggy\n* Spend Xmas in the snow\n* Spend Xmas in the sun\n* Road trip around Europe\n* Sleep in a treehouse\n* Stay at an underwater hotel\n* Visit New Zealand\n* Stay in a Water bungalow\n* Trip to Vegas\n* See the Grand canyon\n* Visit the Hover damn\n* Holiday in Bali\n* Go to San Francisco\n* Run the Rocky Steps in Philadelphia \n* Relax in the Blue lagoon in Iceland\n* Take the Guinness Brewery tour in Dublin\n* Zero gravity plane ride\n* Sell some wood creations I made\n* Climb Snowdon\n* Volunteer \n* Take a photo every day for a year\n* Go to watch gymnastics \n* Watch strongman competition \n* Wedding reunion in Cyprus \n* Learn to dive into water\n* Donate a bench with your name on it\n* Watch a demolition","bodyHtml":"<p>My last birthday was one of the bigger ones. 40 years old. While I wasn&#39;t particulary sad at turning 40 it did make be think about all the things I&#39;d accomplished so far and about how I thought I may have achieved a few other goals by this age.</p>\n<p>With that in mind I got thinking about the next 10 year block and how I could make that as enjoyable, productive and fulfilling as possible.</p>\n<p>I decidied to compose a bucket list, normally a list of things you hope to do in your lifetime, instead this one would be limited to 100 items and a timeframe of 10 years.</p>\n<p>I figured that if I knock off all 100 things on this list I&#39;m going to have some good stories to talk about on my 50th birthday.</p>\n<p>Super simple maths - 100 items in ten years is 10 per year so aprox 1 a month with a couple months left out. </p>\n<p>Some of the items are much harder/larger than others and will take a whole bunch of effort to achieve. Some can probably be batched up a few at a time etc, some are simple things that maybe easy to achieve but for whatever reason I&#39;ve no goten around to completing them thus far.</p>\n<p>Here is the list:</p>\n<ul>\n<li>Stand under a waterfall</li>\n<li>Arrive be seaplane</li>\n<li>Catch a wave surfing</li>\n<li>Mush a dog sled</li>\n<li>Travel on a Zip line</li>\n<li>Do a Backflip</li>\n<li>Go Fatbiking</li>\n<li>Paddle board on a warm ocean</li>\n<li>Go in a submarine</li>\n<li>Drive a tank</li>\n<li>Drive a rally car</li>\n<li>Drive a supercar</li>\n<li>Fly in a helicopter</li>\n<li>Learn to scuba dive</li>\n<li>Walk a rope bridge</li>\n<li>Zorbing</li>\n<li>Feed/Wash an elephant</li>\n<li>Climb a volcano</li>\n<li>Relax in a natural hot spring</li>\n<li>Sleep in an igloo</li>\n<li>Visit the ice hotel</li>\n<li>Start a fire by rubbing sticks together</li>\n<li>Swim with sea turtles</li>\n<li><strong>Drive a digger - <a href=\"/drive-a-digger\">Done</a></strong></li>\n<li>See the northern lights</li>\n<li>Live by the sea</li>\n<li>Meet someone famous - (define this)</li>\n<li>Have a book published</li>\n<li>Create a family tree</li>\n<li>Learn to carve wood</li>\n<li>Make pottery on a wheel</li>\n<li>Be in a TV show audience</li>\n<li>Be an extra in a film</li>\n<li>Fly first/business class</li>\n<li>See a ted talk live</li>\n<li>Watch the Hakka live</li>\n<li>See a live Wimbledon match</li>\n<li>Set a guinness world record</li>\n<li>Watch a rocket launch</li>\n<li>Go in a sensory deprivation tank</li>\n<li>Take a mud bath</li>\n<li>Catch, cook and eat a fish</li>\n<li>Create an ice sculpture</li>\n<li>Create a signature dish</li>\n<li>Eat a 10 course meal</li>\n<li>Eat an insect</li>\n<li>Eat at a michelin 3-star restaurant</li>\n<li>Eat fondue</li>\n<li>Learn a song on the piano </li>\n<li>Make cheese</li>\n<li>Make my own wine</li>\n<li>Stomp grapes</li>\n<li>Have cooking lesson from a famous chef</li>\n<li>Eat a deep fried mars bar</li>\n<li>Do random act of kindness</li>\n<li>Give blood</li>\n<li>Help someone complete something on their bucket list</li>\n<li>Learn to speak another language</li>\n<li>2 min Handstand</li>\n<li>One arm hand stand</li>\n<li>One arm chin up</li>\n<li>Planche</li>\n<li>Manna</li>\n<li>Iron cross</li>\n<li>Front lever</li>\n<li>Side lever</li>\n<li>Go deep sea fishing</li>\n<li>Shoot a machine gun</li>\n<li>Ride a snowmobile</li>\n<li>Drive speed boat</li>\n<li>Have a go on a Jetski</li>\n<li>Ride a Segway</li>\n<li>Drive a dune buggy</li>\n<li>Spend Xmas in the snow</li>\n<li>Spend Xmas in the sun</li>\n<li>Road trip around Europe</li>\n<li>Sleep in a treehouse</li>\n<li>Stay at an underwater hotel</li>\n<li>Visit New Zealand</li>\n<li>Stay in a Water bungalow</li>\n<li>Trip to Vegas</li>\n<li>See the Grand canyon</li>\n<li>Visit the Hover damn</li>\n<li>Holiday in Bali</li>\n<li>Go to San Francisco</li>\n<li>Run the Rocky Steps in Philadelphia </li>\n<li>Relax in the Blue lagoon in Iceland</li>\n<li>Take the Guinness Brewery tour in Dublin</li>\n<li>Zero gravity plane ride</li>\n<li>Sell some wood creations I made</li>\n<li>Climb Snowdon</li>\n<li>Volunteer </li>\n<li>Take a photo every day for a year</li>\n<li>Go to watch gymnastics </li>\n<li>Watch strongman competition </li>\n<li>Wedding reunion in Cyprus </li>\n<li>Learn to dive into water</li>\n<li>Donate a bench with your name on it</li>\n<li>Watch a demolition</li>\n</ul>\n","dir":"content","base":"bucket-list.json","ext":".json","sourceBase":"bucket-list.md","sourceExt":".md"}

