module.exports = {"title":"Drive a Digger","date":"2017-07-17T22:12:03.284Z","layout":"post","path":"/drive-a-digger","bodyContent":"![Digger](/images/drive-a-digger.jpg)\n\n## First item ticked off the list!\n\nFor as long as I can remember I have wanted to drive a big digger. Everytime I drove past one on a building site I'd mention to anyone else in the car at the time that I wanted to have a go.\n\nSo as a birthday present my wife bought me 90min lesson with one to one instruction at DiggerLand in Kent\n\nIt was a really good experience. After some basic instruction about what the controls were and a little practice in a coned off area I then got to drive to the 'digging area'. \n\nThe ride in this thing is bumpy and jerky and it takes a while to get where it is going but I'm pleased I got to move it to the digging spot.\n\nFrom there the instructor gave me some more pointers again of the basic controls and I got to spend 10-15 mins doing some basic digging.\n\nABout every 10 mins the instructor would jump back in the cab and give a few more pointer on digging technique, trying to smoothly uses the controls in conjuntion with each other to get an efficient action. \n\nWe also went over how to backfill and level the areas that we dug.\n\nThere was a final challenge at the end to dig the biggest hole I could in 5 mins followed by filling it back in and making it smooth again within the same timeframe.\n\nAll in all I very enjoyable day being a big kid and achieving something I always wanted to do.\n\n## Whats Next?\n\nThe next things on the list I have planned are riding [the fastest zip line in the world](/blog/zipworld) and the longest in Europe (currently) in North Wales. If the weather permits we are also planning walking up [Snowdon](/blog/snowdon) in the same weekend.","bodyHtml":"<p><img src=\"/images/drive-a-digger.jpg\" alt=\"Digger\"></p>\n<h2 id=\"first-item-ticked-off-the-list-\">First item ticked off the list!</h2>\n<p>For as long as I can remember I have wanted to drive a big digger. Everytime I drove past one on a building site I&#39;d mention to anyone else in the car at the time that I wanted to have a go.</p>\n<p>So as a birthday present my wife bought me 90min lesson with one to one instruction at DiggerLand in Kent</p>\n<p>It was a really good experience. After some basic instruction about what the controls were and a little practice in a coned off area I then got to drive to the &#39;digging area&#39;. </p>\n<p>The ride in this thing is bumpy and jerky and it takes a while to get where it is going but I&#39;m pleased I got to move it to the digging spot.</p>\n<p>From there the instructor gave me some more pointers again of the basic controls and I got to spend 10-15 mins doing some basic digging.</p>\n<p>ABout every 10 mins the instructor would jump back in the cab and give a few more pointer on digging technique, trying to smoothly uses the controls in conjuntion with each other to get an efficient action. </p>\n<p>We also went over how to backfill and level the areas that we dug.</p>\n<p>There was a final challenge at the end to dig the biggest hole I could in 5 mins followed by filling it back in and making it smooth again within the same timeframe.</p>\n<p>All in all I very enjoyable day being a big kid and achieving something I always wanted to do.</p>\n<h2 id=\"whats-next-\">Whats Next?</h2>\n<p>The next things on the list I have planned are riding <a href=\"/blog/zipworld\">the fastest zip line in the world</a> and the longest in Europe (currently) in North Wales. If the weather permits we are also planning walking up <a href=\"/blog/snowdon\">Snowdon</a> in the same weekend.</p>\n","dir":"content","base":"drive-a-digger.json","ext":".json","sourceBase":"drive-a-digger.md","sourceExt":".md"}

